import React, { useState } from "react";
import About from "./pAbout";
import Admin from "./Admin";

function App() {
  const [formSubmissions, setFormSubmissions] = useState([]);

  const handleFormSubmit = (formData) => {
    setFormSubmissions([...formSubmissions, formData]);
  };

  return (
    <div>
      <About formSubmissions={formSubmissions} onFormSubmit={handleFormSubmit} />
      <Admin formSubmissions={formSubmissions} onFormSubmit={handleFormSubmit} />
    </div>
  );
}

export default App;
